  Military Reserve.
  01> MACLEAN, Mary Way m on 09.12.1950 to CORKILL, Thomas Mackenzie (Tom)
  b 22.05.1925
  b 16.09.1926
  Mary b. and m, at Lower Hutt. Thomas, s/o Dr Thomas Frederick Corkill and
  Edith Annie Morrison, b, at Wellington. Address: la Trelissick Crescent,
  Ngaio, Wellington 6004.
  Mary was educated at Chilton Saint James. She trained as a Karitane nurse and
  later was librarian at the Dominion Physical Laboratory. She was President of
  the South Canterbury Writers' Guild, a foundation member of the South
  Canterbury Community Arts Council and a member of the NZ Women Writers' Society. Her interests include
  writing, painting, spinning, croquet and tramping.
  Tom was educated at Scots College and Otago University. He trained for the Presbyterian ministry at
  Knox College, Dunedin and Westminster College, Cambridge and served in parishes at Westport; Maori
  Hill, Dunedin; Timaru; Napier and Motueka. In 1980 he was Moderator of the General Assembly of the
  Presbyterian Church of NZ.
  Mary and Tom live in retirement in Wellington.
  01> CORKILL, Bruce Andrew m on 20.06.1987 to WALLACE, Marilyn Ann
  b 01.02.1952
  b 05.09.1950
  Bruce b. at Cambridge, England and m, at Wellington. Marilyn, d/o John Wallace and Elizabeth Mary
  Dickie, b. at Blenheim, Address: 37 Grant Road, Thorndon, Wellington.
  Bruce was educated at John McGlashan College, Dunedin and Otago University. He practices as a
  barrister in Wellington.
  Marilyn was educated at Marlborough Girls' College and Otago University. She practises as a
  barrister in Wellington.
  01> CORKILL, Alexander Wallace
  b 22.02.1988
  Alexander b. at Wellington.
  02> CORKILL, Gillian Mary m on 08.01.1977 to LAWRENCE, Richard Hume
  b 18.03.1954
  b 03.09.1952
  Gillian b. at Wellington and m. at Timaru. Richard, s/o Peter Lawrence and Morag Matheson, b. at
  Christchurch. Address: 8 Fleming Place, Chedworth Park, Hamilton,
  Gillian was educated at Columba College, Dunedin, Timaru Girls' High School, Otago University and
  Dunedin Teachers' Training College. She was Assistant to the Secretary of the Negotiating Churches
  Unity Council and is presently librarian for Environment Waikato.
  Richard was educated at Christchurch Boys' High School and Otago University. He trained for the
  Presbyterian ministry at Knox College, Dunedin. He has served in parishes at Picton, Johnsonville
  Union, Wellington and St Andrew's, Hamilton,
